import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <p>
          Hello World!
        </p>
      </header>
      <p className="App-logo">
        <ul>
          <li>Apples</li>
          <li>Oranges</li>
          <li>Strawberries</li>
        </ul>
      </p>
    </div>
  );
}

export default App;
